const actions = {
    LOGIN_BEGIN: 'LOGIN_BEGIN',
    LOGIN_SUCCESS: 'LOGIN_SUCCESS',
    LOGIN_ERR: 'LOGIN_ERR',



    loginBegin: () => {
        return {
            type: actions.LOGIN_BEGIN,
        };
    },

    loginSuccess: data => {
        return {
            type: actions.LOGIN_SUCCESS,
            data,
        };
    },

    loginErr: err => {
        return {
            type: actions.LOGIN_ERR,
            err,
        };
    },

};

export default actions;
